import Head from 'next/head';
import Navbar from './NavBar';
import { ThemeProvider, CSSReset } from "@chakra-ui/core"
import customTheme from "../theme/theme.js"


const Layout = (props) => (
    <ThemeProvider>
        <CSSReset />
        <div className="bg-black">
            <Head>
                <title>SpaceX</title>
                <link href="https://fonts.googleapis.com/css2?family=Bebas+Neue&family=Poppins:wght@400;500;600;700;800;900&display=swap" rel="stylesheet"></link>
            </Head>
            <Navbar />
            {props.children}
        </div>
    </ThemeProvider>
);

export default Layout;
